import React from 'react'

function UserList(props) {
  return (
    <div>
      {props.articles && users.map(user => {
            return (
              <div key = {user.id}>
                <h2>{user.username}</h2>
                <h2>{user.password}</h2>
                
              </div>
            )
          })}
    </div>
  )
}

export default UserList
